import React from 'react';
import styled from 'styled-components';

const HeadBar = styled.div`
width: 100%;
height: 80px;
background-color: blue;
text-align: center;
color: white;
justify-items: center;
`;

const Header = () => {
    return ( 
    <HeadBar>
      Tak's Hockey
    </HeadBar> );
}
 
export default Header;
